import React, { useContext } from "react";
import { Context } from "../../context/context";
import { Link } from "react-router-dom";
import { Swiper, SwiperSlide, useSwiper } from "swiper/react";
const Category = () => {
  const { listProducts } = useContext(Context);

  const sweetCake = listProducts.filter((card) => card.categorysId === 1);
  const saltedCake = listProducts.filter((card) => card.categorysId === 2);
  const cupCake = listProducts.filter((card) => card.categorysId === 3);
  const cheeseCake = listProducts.filter((card) => card.categorysId === 4);

  const SlideNextButton = () => {
    const swiper = useSwiper();
    return (
      <div className="flexCenter r-buttons">
        <button onClick={() => swiper.slidePrev()} className="r-prevButton">
          &lt;
        </button>
        <button onClick={() => swiper.slideNext()} className="r-nextButton">
          &gt;
        </button>
      </div>
    );
  };
  const sliderSettings = {
    slidesPerView: 1,
    spaceBetween: 50,
    breakpoints: {
      480: {
        slidesPerView: 1,
      },
      600: {
        slidesPerView: 2,
      },
      750: {
        slidesPerView: 3,
      },
      1100: {
        slidesPerView: 4,
      },
    },
  };
  return (
    <div>
      <div>
        <div className="flex flex-col items-center justify-center gap-4 ">
          <div className="flex ">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Ngọt</span>
          </div>
          <div className=" flex justify-center items-center">
            <Swiper {...sliderSettings}>
              <SlideNextButton />
              {/* slider */}
              {sweetCake.slice(0, 4).map((card, i) => (
                <SwiperSlide key={i}>
                  {sweetCake?.map((card) => {
                    return (
                      <div className="">
                        <Link
                          to={`/card/${card.id}`}
                          className="flex flex-col gap-1  r-card"
                        >
                          <img src={card.image} className="img-card" />
                          <div>{card.name}</div>
                          <div>{card.price}</div>
                        </Link>
                      </div>
                    );
                  })}
                </SwiperSlide>
              ))}
            </Swiper>
          </div>

          <div className="flex ">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Mặn</span>
          </div>
          <div className="flex flex-row">
            {saltedCake?.map((card) => {
              return (
                <div>
                  <Link
                    to={`/card/${card.id}`}
                    className="flex flex-col gap-1  r-card"
                  >
                    <img src={card.image} className="img-card" />
                    <div>{card.name}</div>
                    <div>{card.price}</div>
                  </Link>
                </div>
              );
            })}
          </div>
          <div className="flex ">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Nướng</span>
          </div>
          <div className="flex flex-row">
            {cupCake?.map((card) => {
              return (
                <div>
                  <Link
                    to={`/card/${card.id}`}
                    className="flex flex-col gap-1  r-card"
                  >
                    <img src={card.image} className="img-card" />
                    <div>{card.name}</div>
                    <div>{card.price}</div>
                  </Link>
                </div>
              );
            })}
          </div>
          <div className="flex">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Kem</span>
          </div>
          <div className="flex flex-row">
            {cheeseCake?.map((card) => {
              return (
                <div>
                  <Link
                    to={`/card/${card.id}`}
                    className="flex flex-col gap-1  r-card"
                  >
                    <img src={card.image} className="img-card" />
                    <div>{card.name}</div>
                    <div>{card.price}</div>
                  </Link>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Category;
